import React from 'react';

const Debug = ({ data }) => {
  return (
    <div className="bg-white border border-gray-300 rounded p-4 my-4 overflow-auto max-h-[500px]">
      <h3 className="text-lg font-bold mb-2">Debug Output</h3>
      <pre className="text-xs">{JSON.stringify(data, null, 2)}</pre>
    </div>
  );
};

export default Debug;
